import React from 'react';
import UnivCard from '../../../components/univ-card';

const Home = () => {
    return (
        <React.Fragment>
            <main>
                <div className="row row-cols-1 row-cols-md-3 mb-3 text-center">
                    <UnivCard />
                </div>
            </main>
        </React.Fragment>
    );
}

export default Home;
